import React from 'react';
import { Diff, Hunk, parseDiff } from 'react-diff-view';
import 'react-diff-view/style/index.css';

const oldCode = `
function MyComponent() {
  return <div>Hello, old world!</div>;
}
`;

const newCode = `
function MyComponent() {
  return <div>Hello, new world!</div>;
}
`;

const diffText = `
--- oldCode
+++ newCode
@@ -1,5 +1,5 @@
 function MyComponent() {
- return ${oldCode.trim().split('\n').map(line => ` - ${line}`).join('\n')}
+ return ${newCode.trim().split('\n').map(line => ` + ${line}`).join('\n')}
 }
`;


const DiffViewer = () => {
  const [diff] = parseDiff(diffText);

  if (!diff || !diff.hunks) {
    return <div>Failed to parse diff</div>;
  }

  return (
    <Diff viewType="split" diff={diff}>
      {hunks => (diff.hunks || []).map(hunk => (
        <Hunk key={hunk.content} hunks={hunk} />
      ))}
    </Diff>
  );
};

export default DiffViewer;
